import React from 'react'
import { useParams } from 'react-router-dom';


function FullLog(props) {
    let logName = useParams().name;
    console.log(logName);
    return (
        <text>
            {JSON.stringify(props.logs[logName])}
        </text>
    );
}

export default FullLog;
